import "../style.css";

export default function NavBar() {
  const path = window.location.pathname;
  return (
    <nav className="nav">
      <ul id="nav-menu">
        <li className="active">
          <a href="/">
            <b>HOME</b>
          </a>
        </li>
        <li>
          <CustomLink href="/compsci">COMPSCI</CustomLink>
        </li>
        <li>
          <CustomLink href="/photovideo">CREATIVE</CustomLink>
        </li>
        <li>
          <CustomLink href="/aboutme">ABOUT ME</CustomLink>
        </li>
      </ul>
    </nav>
  );
}

function CustomLink({ href, children, ...props }) {
  return <a href={href}>{children}</a>;
}
